import React from 'react';

class Link extends React.Component {
    render() {
        return(
            <React.Fragment>
              <a href='https://skillcrush.com/blog/web-developer-portfolios/'>{this.props.name}</a>  
            </React.Fragment>
        )
    }
}

export default Link;
